import logo from "./logo.svg";
import "./App.css";

function App() {
  const getData = (url) => {
    const data = fetch(url)
      .then((res) => res.text())
      .then((text) => JSON.parse(text.substr(47).slice(0, -2)));

    return data;
  };

  getData(
    "https://docs.google.com/spreadsheets/d/1CaEwqnqAHElnM_sOKOn9m92XWqnSCv_XnHQlncy5Vl4/gviz/tq?tqx=out:json"
  );

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
